          <button>Services</button>
          <button>Photos</button>
          <hr />
        </div>
        <img
          className
          src={require('../../img/Bun-blanc.png')}
          alt='Navlogo'
        ></img>
        <div>
          <button>Informations</button>
          <button>Contacts</button>
          <button>About us</button>
          <hr />
        </div>
      </div>
    );
  }
}

export default Navbar;
